/*Table structure for table `incidents` */

DROP TABLE IF EXISTS `incidents`;

CREATE TABLE `incidents` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `incident_number` varchar(100) DEFAULT NULL,
  `reported` varchar(100) DEFAULT NULL,
